int main(void){
    set_A9_IRQ_stack();
    config_GIC();
    config_KEYs();
    config_PS2();
    enable_A9_interrupts();

    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;

    // declare other variables
    struct point* P1;
    struct point* P2;
    struct point pp1;
    struct point pp2;
    P1 =&pp1;
    P2= &pp2;
    // initialize location and direction of rectangles(not shown)
    initialize(P1,P2);
    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the
                                        // back buffer

    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();

    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

    while (1)
    {
        /* Erase any boxes and lines that were drawn in the last iteration */
        clear_screen();
        draw_background();
        draw_platform(100,100);
        // code for drawing the boxes and lines
        draw_characters(P1,P2);

        // code for updating the locations of boxes
        update(P1,P2);
        wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }
    if(KEYBOARD_UP == true)
      printf("Hello");
}

/////////////Implementations/////////////

void initialize (struct point* P1, struct point* P2){
    P1->x = 64;
    P1->y = 192;
    P2->x = 256;
    P2->y = 192;
    P1->dx = 16;
    P1->dy = 16;
    P2->dx = 16;
    P2->dy = 16;
}

void draw_characters(struct point* P1, struct point* P2){
    int width = 32;
    int left_corner_x1;
    int left_corner_y1;
    int left_corner_x2;
    int left_corner_y2;
    left_corner_x1 =P1->x-width;
    left_corner_y1 =P1->y-width;
    left_corner_x2 = P2->x-width;
    left_corner_y2 = P2->y-width;
    for (int i=0;i<64;++i) {
    for (int j=0;j<64;++j) {
        if (P1->x>=32&&P1->x<=288&&P1->y>=32&&P1->y<=208&&player1[j* 64 + i] != 0x0000)
            plot_pixel(left_corner_x1+i, left_corner_y1+j, player1[j * 64 + i]);
        if (P2->x>=32&&P2->x<=288&&P2->y>=32&&P2->y<=208&&player2[j * 64 + i] != 0x0000)
            plot_pixel(left_corner_x2+i, left_corner_y2+j, player2[j * 64 + i]);
        }
    }}

void update(struct point* P1, struct point* P2){
    if (P1->x>=32&&P1->x<=288&&P1->y>=32&&P1->y<=208){
    P1->x += 0;
    P1->y -= 0;
    }
    else {
    P1->x -= 0;
    P1->y -= 0;
    }
    if (P2->x>=32&&P2->x<=288&&P2->y>=32&&P2->y<=208){
    P2->x -= P2->dx;
    if (KEYBOARD_UP)
    P2->y -= P2->dy;
        if (KEYBOARD_DOWN){
            P2->y += P2->dy;
        }
    }
    else{
    P2->x += 0;
    P2->y -= 0;
    }

    KEYBOARD_UP=false;
    KEYBOARD_DOWN=false;
}

void wait_for_vsync() {
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020; // Buffer register
    register int status;

    *pixel_ctrl_ptr = 1; // start the synchronization process

    status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0) {
        status = *(pixel_ctrl_ptr + 3);
    }
}

void swap(int*x, int*y){
    int temp = *x;
    *x = *y;
    *y = temp;
}

void clear_screen() {
    int x;
    int y;
    for (x = 0; x < 320; x++)
        for (y = 0; y < 240; y++)
            plot_pixel(x, y, 0x0000);
}

void draw_line (int x0, int y0, int x1, int y1, short int color) {
    bool is_steep = abs(y1 - y0) > abs (x1 -x0);
    if (is_steep) {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }
    if (x0 > x1) {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int deltax = x1 - x0;
    int deltay = abs(y1 - y0);
    int error = -(deltax / 2);
    int y = y0;
    int y_step;
    if (y0 < y1) {
        y_step = 1;
    } else {
        y_step = -1;
    }

    for (int x = x0; x <= x1; x++) {
        if (is_steep) {
            plot_pixel(y, x, color);
        } else {
            plot_pixel(x, y, color);
        }
        error += deltay;
        if (error >= 0) {
            y += y_step;
            error -= deltax;
        }
    }
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void draw_background(){
    int x;
    int y;
    for (x = 0; x < 320; x++)
        for (y = 0; y < 240; y++)
            plot_pixel(x, y, background[y*320 + x]);
}

void draw_platform(int xPos, int yPos){
    int x;
    int y;
    for (x = 0; x < 80; x++)
        for (y = 0; y < 12; y++)
            plot_pixel(x+xPos, y+yPos, platform[y*80 + x]);
}
